void Inovelli_VZM36Fo_exec(plc_sThread* tp, pwr_sClass_Inovelli_VZM36Fo* o)
{
  pwr_sClass_Inovelli_VZM36* co = (pwr_sClass_Inovelli_VZM36*)o->PlcConnectP;
  if (*o->state_toggleP) {
    pwr_tBoolean* p = gdh_TranslateRtdbPointer((unsigned long)co->state.ActualValue);
    *p = *p ? 0 : 1;
  }
  if (*o->state_onP) {
    pwr_tBoolean* p = gdh_TranslateRtdbPointer((unsigned long)co->state.ActualValue);
    *p = 1;
  }
  if (*o->state_offP) {
    pwr_tBoolean* p = gdh_TranslateRtdbPointer((unsigned long)co->state.ActualValue);
    *p = 0;
  }
  if (*o->brightness_upP) {
    pwr_tInt32* p = gdh_TranslateRtdbPointer((unsigned long)co->brightness.ActualValue);
    *p += co->BrightnessIncr;
    if (*p > co->brightness.PresMaxLimit)
      *p = co->brightness.PresMaxLimit;
  }
  if (*o->brightness_downP) {
    pwr_tInt32* p = gdh_TranslateRtdbPointer((unsigned long)co->brightness.ActualValue);
    *p -= co->BrightnessIncr;
    if (*p < co->brightness.PresMinLimit)
      *p = co->brightness.PresMinLimit;
  }
  if (*o->brightness_moveupP) {
    o->brightness_mup = 1;
    o->brightness_mdown = 0;
    o->brightness_mtime = 1;
  }
  if (*o->brightness_movedownP) {
    o->brightness_mdown = 1;
    o->brightness_mup = 0;
    o->brightness_mtime = 1;
  }
  if (o->brightness_mup) {
    o->brightness_mtime += *o->ScanTime;
    if (o->brightness_mtime >= 0.25) {
      o->brightness_mtime = 0;
      pwr_tInt32* p = gdh_TranslateRtdbPointer((unsigned long)co->brightness.ActualValue);
      *p += co->BrightnessIncr;
      if (*p >= co->brightness.PresMaxLimit) {
        *p = co->brightness.PresMaxLimit;
        o->brightness_mup = 0;
      }
    }
  }
  if (o->brightness_mdown) {
    o->brightness_mtime += *o->ScanTime;
    if (o->brightness_mtime >= 0.25) {
      o->brightness_mtime = 0;
      pwr_tInt32* p = gdh_TranslateRtdbPointer((unsigned long)co->brightness.ActualValue);
      *p -= co->BrightnessIncr;
      if (*p <= co->brightness.PresMinLimit) {
        *p = co->brightness.PresMinLimit;
        o->brightness_mdown = 0;
      }
    }
  }
  if (*o->brightness_movestopP) {
    o->brightness_mtime = 0;
    o->brightness_mup = 0;
    o->brightness_mdown = 0;
  }
}
